UPDATE `npc_text` SET `em0_0`=0,`em0_1`=1,`text1_0`='Ye might not know it, but in addition to being a skilled tailor, Jormund is also a slayer of giants!  Why he must have overheard a few of us sharing stories when he shouted that he\'d killed seven with one blow!  $B$BYe should pay him a visit at his store on the north side of The Great Forge an\' see if he\'ll tell ye the tale!',`text1_1`='Ye might not know it, but in addition to being a skilled tailor, Jormund is also a slayer of giants!  Why he must have overheard a few of us sharing stories when he shouted that he\'d killed seven with one blow!  $B$BYe should pay him a visit at his store on the north side of The Great Forge an\' see if he\'ll tell ye the tale!' WHERE `ID`=2807;
UPDATE `npc_text` SET `text0_0`='Welcome to the front lines, $c.  The Kingdom of Stormwind, with the aid of its allies, has sent me here to counter the growing threat of the Scourge.  Here at Chillwind Camp, we fight for our continued survival on a daily basis.$B$BIf you\'ve come here looking for a chance to prove yourself as a hero, then you\'ll find plenty of opportunities to do so... especially as we push towards Andorhal and whatever malign force that controls the Scourge there.',`em0_0`=0,`em0_1`=66 WHERE `ID`=3754;
UPDATE `npc_text` SET `em0_0`=0,`em0_1`=1 WHERE `ID`=3985;
