UPDATE `npc_text` SET `em0_0`=0,`em0_1`=2,`em0_2`=0,`em0_3`=1,`em0_5`=1 WHERE `ID`=4041;
UPDATE `npc_text` SET `text0_1`='Well met, friend.  I am Officer Pureheart, and I am a proud member of a world-wide organization known as the Argent Dawn.  Our cause is simple - fight swiftly and mercilessly against any element of evil that surfaces in Azeroth.  We are not a political body, nor do we ever wish to become one.  To that end we call both the Alliance and the Horde both as friends - friends in the cause of stamping out evil!$B$BFor the Dawn, my $g brother : sister;!',`em0_0`=0,`em0_1`=66 WHERE `ID`=4135;
UPDATE `npc_text` SET `text0_0`='The Argent Dawn salutes you, $c!  The name\'s Lightspark, and I\'m an authorized equipment and materiel quartermaster for the Dawn.$B$BAs you fight evil under our commission - all the while earning our respect and trust - you\'ll earn valor tokens from Officer Pureheart.  Tokens serve two purposes: use them to gain increased standing within our ranks, or use them as tender in acquiring special items.$B$BAs you improve your standing with the Dawn, you\'ll discover that more items will be made available to you.',`em0_0`=0,`em0_1`=66 WHERE `ID`=4193;
UPDATE `npc_text` SET `em0_0`=0,`em0_1`=1 WHERE `ID`=4859;
