UPDATE `npc_text` SET `text0_0`='What weapon in particular interests you?' WHERE `ID`=6290;
UPDATE `npc_text` SET `text0_0`='The esteemed Doctor Gustaf VanHowzen can train you further.  He can be found in Theramore treating the wounded at the barracks.',`text0_1`='The esteemed Doctor Gustaf VanHowzen can train you further.  He can be found in Theramore treating the wounded at the barracks.' WHERE `ID`=7026;
