UPDATE `npc_text` SET `em0_0`=0,`em0_1`=1 WHERE `ID`=7196;
UPDATE `npc_text` SET `text0_0`='The Paragons of Power are remnants from the ancient Gurubashi Empire.  We Zandalar seek them - not only are they of tremendous collectible value to us, but we believe that they also hold latent signatures of magic used by the old Empire.$B$BYou\'ll more than likely discover three kinds of Paragons in Zul\'Gurub: coins, bijous, and primal items.  Bring them to us in the quantities that we seek, and you\'ll be rewarded with some of the finest items we Zandalar have ever crafted.$B' WHERE `ID`=7634;
UPDATE `npc_text` SET `text0_1`='The Paragons of Power are remnants from the ancient Gurubashi Empire.  We Zandalar seek them - not only are they of tremendous collectible value to us, but we believe that they also hold the strongest of mojo used by the old Empire.$B$BYa can expect to be findin\' three kinds of Paragons in Zul\'Gurub: coins, bijous, and primal items.  Bring them to us in the quantities that we seek, and you\'ll be rewarded with the some of the finest items we Zandalar have ever crafted.$B$BCount on it, mon!$B$B' WHERE `ID`=7707;
UPDATE `npc_text` SET `text0_0`='There is more to magic than just arcane gesticulations... but I am speaking to someone who already knows this, yes?$B$BYou\'ve come to me to learn, and learn you will... just so long as you pay attention and do as I say.  The secrets of the demons do not cater to fools, and neither do I.',`text0_1`='',`prob0`='1.0' WHERE `ID`=7882;
UPDATE `npc_text` SET `text0_0`='\"Great job collecting resources for the war,\" they said, \"Have a promotion,\" they said.  What they really meant is \"You\'re stationed outside a bughive in Silithus with a bunch of sweaty dwarves, Carnes!\"$B$BThanks for the promotion, Captain!',`em0_0`=0,`em0_1`=1,`em0_3`=5 WHERE `ID`=8212;
UPDATE `npc_text` SET `text0_0`='This is a great day, $c!',`text0_1`='',`prob0`='1.0' WHERE `ID`=8965;
UPDATE `npc_text` SET `text0_0`='Finally, everything is in place. Are you ready for your big stage debut?',`text0_1`='' WHERE `ID`=8970;
UPDATE `npc_text` SET `text0_0`='Don\'t worry, you\'ll be fine. You look like a natural!',`text0_1`='',`prob0`='1.0' WHERE `ID`=8971;
UPDATE `npc_text` SET `text1_1`='Learning about new plant species is extremely important for our expedition.  Not just the medicinal or edible ones either.$B$BPlants provide the foundation for many other forms of life to exist.  Understanding them allows us to better understand nature as a whole.' WHERE `ID`=9199;
UPDATE `npc_text` SET `em0_0`=0,`em0_1`=2 WHERE `ID`=9238;
UPDATE `npc_text` SET `text0_1`='$C, hold your attack, this is just a disguise!  I\'m a spy working for the Lower City coalition out of Shattrath City.$B$BI hope you\'re here to help!' WHERE `ID`=9827;
UPDATE `npc_text` SET `text0_0`='Do they never rest?!$B$BIf we\'re to secure a future for the people of the Lower City, we must deal with the Shadow Council before they cause an even greater cataclysm than the Bone Wastes!$B$BBecause the leadership of Shattrath City will not move quickly, we the free people of the Lower City have taken matters into our own hands.$B$BBut our spies have been discovered.  We will hold off the Shadow Council\'s agents while you slip into the labyrinth and see what you can uncover.',`text0_1`='' WHERE `ID`=9833;
UPDATE `npc_text` SET `text0_0`='Long ago, in a dimension of the cosmos unfathomable to mortal minds, there was born - if such a term can be used for it - a being of such unbelievable power that its very entrance into existence shattered all reality around it.$B$BKnown only as Murmur, it was the essence of sound, and to hear it speak was to know death eternal!' WHERE `ID`=9834;
UPDATE `npc_text` SET `text0_0`='Existing only for chaos, its slightest whisper meant the destruction of whole worlds!$B$BYet still, there were those that would try to worship this mindless being.  There were even those more insane who dared to think to control it!' WHERE `ID`=9835;
UPDATE `npc_text` SET `text0_0`='The musty pages of the codex seem to magically turn themselves, guiding your attention to a specific chapter past horrors no mortal eyes should ever perceive.$B$BThe book opens to a page that somehow feels \'right,\' yet so very wrong.' WHERE `ID`=9836;
UPDATE `npc_text` SET `text0_0`='And lo, how the mighty fell trembling at its feet, fearful that it might direct its words upon them.$B$BBut still did these charlatans, these worshipping pretenders to a non-existent religion, rail against the inevitable in a vain attempt to control their \'god.\'  Uncaring, and likely not even noticing them, Murmur yawned and they knew oblivion.$B$BYet one somehow managed to survive, and in his insanity found a way to bring Murmur into the world.' WHERE `ID`=9837;
UPDATE `npc_text` SET `text0_0`='And summon forth Murmur they did.$B$BPowerful magics of containment and silencing were employed, held together by the constant supply of souls being fed into them.  Yet still they could not control the beast, could not bend it to their will.$B$BThese mortals began to devise different strategies, and one after the other they all failed.  And in so doing, they weakened the rituals, accidentally giving Murmur the slightest modicum of freedom.$B$BIt was all that was needed.' WHERE `ID`=9839;
UPDATE `npc_text` SET `text0_0`='Welcome, friend of the free people of the Lower City, but do not tarry long.$B$BThere are sounds of battle coming from within.  My compatriots could use your assistance!',`text0_1`='',`prob0`='1.0' WHERE `ID`=9917;
UPDATE `npc_text` SET `text0_0`='It is said that those who are blessed by the spirits of Auchindoun possess the ability to capture powerful souls in the form of Spirit Shards. I have come across a few of these Spirit Shards throughout my travels but have yet to unlock their secrets. $B$BThe only thing I have been able to discern is that they seem to originate from the depths of Auchindoun itself. If you happen to come across any of these Spirit Shards I\'m sure I could make it worth your while to allow me to take them off your hands...',`text0_1`='',`prob0`='1.0' WHERE `ID`=9921;
UPDATE `npc_text` SET `prob0`='1.0',`em0_0`=0,`em0_1`=1,`em0_2`=1000,`em0_3`=1 WHERE `ID`=9959;
UPDATE `npc_text` SET `prob0`='1.0',`em0_0`=0,`em0_1`=1 WHERE `ID`=10001;
UPDATE `npc_text` SET `text0_0`='What do you know about ethereals, fleshling?$B$BYou undoubtedly view us all in the same light, oblivious to the conflicts and struggles between the differing factions.$B$BPerhaps it is time for an introduction. I am Commander Ameer of the Protectorate - also your only hope of resolving the infestation of both void creature and Ethereum in this area.$B' WHERE `ID`=10058;
UPDATE `npc_text` SET `text0_0`='Agent Ya-six and I were given a high priority mission from Protectorate command to eradicate all signs of void creature infestation at Ultris. These were to be tactical strikes. Our last hit before returning to the Protectorate Watch Post was to be on a void lord named Arconus who had been getting fat off the fleshlings of the area.$B$BUnfortunately, we arrived a bit late. Ya-six and I got separated in the firefight with the flesh beasts. Now he\'s trapped inside, pinned down behind enemy lines.$B',`em0_0`=0,`em0_3`=1 WHERE `ID`=10065;
