UPDATE `npc_text` SET `text0_0`='Wait. Where are you going? You needed a transfer, correct? Let\'s just get it done and over with, ok? Zuluhed at Dragonmaw? It will be done. Please let Lord Illidan know that his orders were carried out with the full cooperation of the Eclipsion.$B$BI will dispatch Ruul the Darkener to personally deliver the fragment!$B$BYou heard me right - Ruul...$B',`prob0`='1.0',`em0_0`=0,`em0_1`=1,`em0_2`=0,`em0_3`=6,`em0_4`=0,`em0_5`=273 WHERE `ID`=10409;
